(9, '“We have to have a wall. We have to have a border. And in that wall we’re going to have a big fat door where people can come into the country, but they have to come in legally.”', '<div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>January 15, 2016 11:21 AM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>Or you get killed at tehy water hole</div></div><div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>January 15, 2016 11:03 AM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>Lucy is africanus</div></div><div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname1250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>December 28, 2015 10:27 PM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>coral way</div></div><div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>December 28, 2015 10:19 PM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>yeah yeaj</div></div>', '3', 'Donald Trump', '2015-10-28 11:21:00', '2015-10-28 00:00:00', '', 'Donald Trump', 'CNBC', 'http://www.cnbc.com/2015/10/28/donald-trump-mexico-going-to-pay-for-wall.html', '', '3', '0', '0'),
(10, '"You know, if you think back to Abraham Lincoln, he was not a loud, bombastic person by any measure. Ungainly, lanky, uncouth, but very courageous and very strong. What I’ve been emphasizing on the road lately is that strength is not defined by the decibels of which you say something or by the gesticulations associated with it, but by the accomplishments of one’s life. What have you faced, and how have you faced those things?"', '', '4', 'Ben Carson', '2015-12-28 00:00:00', '2015-12-28 00:00:00', '', 'Ben Carson', 'Interview', 'https://www.washingtonpost.com/politics/ben-carson-on-the-brink-a-process-like-this-is-pretty-brutal/2015/12/27/d0c5c1bc-a9e1-11e5-9b92-dea7cd4b1a4d_story.html', 'Washington Post', '3', '0', '0'),
(12, 'And I guess at the end of the day, for me—you know, people talk about their extraordinary grandchildren, but I actually have one—and we’re going to do everything we can to give her opportunities…', '', '2', 'Hillary Clinton', '2016-01-17 00:00:00', '2016-01-17 00:00:00', '2', 'Hillary Clinton', 'Breitbart Magazine', 'http://www.breitbart.com/big-government/2016/01/16/hillary-clinton-attacks-bernie-sanders-adopted-grandchildren-i-actually-have-a-grandchild/', 'MSNBC', '5', '0', '0'),
(16, '"The U.S. has become a dumping ground for everybody else''s problems. Thank you. It''s true, and these are the best and the finest. When Mexico sends its people, they''re not sending their best. They''re not sending you. They''re not sending you. They''re sending people that have lots of problems, and they''re bringing those problems with us. They''re bringing drugs. They''re bringing crime"', '', '3', 'Donald Trump', '2015-06-15 00:00:00', '2015-06-15 00:00:00', '3', 'Donald Trump', 'Interview', 'http://www.realclearpolitics.com/video/2015/06/16/trump_mexico_not_sending_us_their_best_criminals_drug_dealers_and_rapists_are_crossing_border.html', 'Real Clear Politics', '0', '0', '0'),
(17, '"Race relations problems are almost at an all-time worst," he said. "And President Obama -- I really thought he''d be a unifier. But I thought one thing he''d be is a unifier certainly between African-American and white, and I will tell you that''s turned out not to be so. He has not been a unifier. He''s been a divider."', '', '3', 'Donald Trump', '2015-08-15 00:00:00', '2015-08-15 00:00:00', '3', 'Donald Trump', 'Interview', 'http://www.cnn.com/2015/08/27/politics/donald-trump-african-american-polls/', 'CNN', '0', '0', '0'),
(19, '"America needs more new workers to help pay for retirees--"to rebuild the demographic pyramid" as he put it. "Immigrants are more fertile," Bush said. "And they love families and they have more intact families, and they bring a younger population. Immigrants create an engine of economic prosperity."', '', '1', 'Jeb Bush', '2013-06-13 00:00:00', '2013-06-13 00:00:00', '1', 'Jeb Bush', 'Conference', 'http://www.ontheissues.org/Archive/2016_Hopefuls_Jeb_Bush.htm', 'Faith and Freedom Coalition Conference', '0', '0', '0'),
(20, '"Too often, these are called women’s issues. Well, I am a proud lifelong fighter for women’s issues, because I firmly believe what’s good for women is good for America. … As far as I’m concerned, any issue that affects women’s lives and futures is a women’s issue."', '', '2', 'Hillary Clinton', '2015-09-05 00:00:00', '2015-09-05 00:00:00', '2', 'Hillary Clinton', 'Lecture', 'https://www.hillaryclinton.com/issues/womens-rights-and-opportunity/', 'https://www.hillaryclinton.com/', '0', '0', '0');
INSERT INTO `president_comments` (`president_commentsID`, `president_commentsCommentData`, `president_commentsCommentDataResponse`, `president_commentsSource`, `president_commentsLastComment_username`, `president_commentsLastComment`, `president_comment_createdate`, `president_commentCreator_ID`, `president_commentCreator_Username`, `president_commentsMedia_type`, `president_commentsMedia_typeLink`, `president_comment_audience`, `president_commentsThumbsUp`, `president_commentsThumbsDown`, `president_commentsReplys`) VALUES
(21, '"Laws have to be backed up with resources and political will,” she explained. “And deep-seated cultural codes, religious beliefs and structural biases have to be changed. As I have said and as I believe, the advancement of the full participation of women and girls in every aspect of their societies is the great unfinished business of the 21st century and not just for women but for everyone — and not just in far away countries but right here in the United States."', '<div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>February 21, 2016 10:12 AM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>Yes we do have cheese</div></div>', '2', 'Hillary Clinton', '2016-02-21 10:12:00', '2015-08-27 00:00:00', '2', 'Hillary Clinton', 'Lecture', 'http://www.theblaze.com/blog/2015/04/27/hillary-clinton-says-religious-beliefs-have-to-be-changed-on-abortion-heres-why-thats-ironic/', '6th annual Women in the World Summit', '0', '0', '1'),
(22, '"We must deal with reality and stop trying to fool the people, because these budgetary issues are a big problem for all of us and for our progeny. We need to relearn the meaning of the word “sacrifice,” which is often necessary before true prosperity is realized."', '<div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>January 26, 2016 2:40 PM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>Does it work</div></div>', '4', 'Ben Carson', '2016-01-26 14:40:00', '2013-10-29 00:00:00', '4', 'Ben Carson', 'Interview', 'http://www.washingtontimes.com/news/2013/oct/29/carson-stop-feeding-the-beast/?page=2', 'Washington Post', '1', '0', '1'),
(23, ' "I think really the things you do in your house, we could just leave those in your house and they wouldn''t have to be part of the workplace,".<br/></br> "I think society is rapidly changing and if you are gay, there are plenty of places that will hire you."', '', '7', 'Rand Paul', '2015-10-14 00:00:00', '2015-10-14 00:00:00', '7', 'Rand Paul', 'Lecture', 'http://www.huffingtonpost.com/entry/rand-paul-lgbt-workers_us_561ed745e4b028dd7ea691a5', 'Drake University', '0', '0', ''),
(24, '"I’m proud to support Israel, America’s longtime friend and ally in the Middle East. \r\n<br/><br/>\r\nIsraeli cafés and buses are bombed, towns are victimized by hundreds of rockets, and its citizens are attacked by Palestinian terrorists.\r\n<br/><br/>\r\nIt’s time we took a stand for Israel by standing up to the enemies of Israel, the enemies that murder Israeli citizens."', '', '7', 'Rand Paul', '2015-10-14 00:00:00', '2015-10-14 00:00:00', '7', 'Rand Paul', 'Interview', 'https://www.randpaul.com/issue/israel', 'Website', '0', '0', '0'),
(25, '"As a physician, one of the first things we learn is to ‘Do no harm.’  Since Roe v. Wade decision, over 50 million children have been killed in abortion procedures. As President, I would strongly support legislation restricting federal courts from hearing cases like Roe v. Wade, in an effort to stop harming the lives of the unborn."', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', 'Website', 'https://www.randpaul.com/issue/sanctity-of-life', 'Interview', '0', '0', '0'),
(26, '"We must pursue policies to transform this country into a nation that affirms the value of its people of color. That starts with addressing the five central types of violence waged against black, brown and indigenous Americans: physical, political, legal, economic and environmental."', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/racial-justice/', 'Interview', '0', '0', '0'),
(27, '"The United States has made remarkable progress on gay rights in a relatively short amount of time. But there is still much work to be done.\n<br/><br/>\nIn many states, it is still legal to fire someone for being gay. It is legal to deny someone housing for being transgender. That is unacceptable and must change. We must end discrimination in all forms."', '<div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>January 28, 2016 5:20 PM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>Gulf stream water. This land was made for youand me.</div></div>', '5', 'Bernie Sanders', '2016-01-28 17:20:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/fighting-for-lgbt-equality/', 'Interview', '0', '0', '1'),
(28, '"This is not a radical idea. Last year, Germany eliminated tuition because they believed that charging students $1,300 per year was discouraging Germans from going to college. Next year, Chile will do the same. Finland, Norway, Sweden and many other countries around the world also offer free college to all of their citizens. If other countries can take this action, so can the United States of America."', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/its-time-to-make-college-tuition-free-and-debt-free/', 'Interview', '0', '0', '0'),
(29, '"First we have to remember what the engine of economic growth is in this nation? Small businesses, family-owned businesses, community-based businesses. Two-thirds of new jobs are created by small businesses. Half of Americans are employed by small businesses. We''re crushing them. We''re now destroying more than we''re creating. That''s why we have to roll back this regulatory burden and take a 75,000-page tax code and make it three pages, because guess what? When you have a big costly, complicated government, only the big, the powerful, wealthy and well connected can deal with it. It''s called crony capitalism. It''s why we must reduce the size of government."', '', '6', 'Carly Fiorina', '2015-08-09 00:00:00', '2015-08-09 00:00:00', '6', 'Carly Fiorina', 'Interview', 'http://ontheissues.org/2016/Carly_Fiorina_Budget_+_Economy.htm', 'Fox News Sunday interviews', '0', '0', ''),
(30, '"We have loads of laws, and most of the time, criminals are breaking those laws and we are curtailing citizens'' lawful rights to carry guns," she said. "The assault weapons ban is extremely arbitrary about what qualifies as an assault weapon."', '', '6', 'Carly Fiorina', '2010-09-02 00:00:00', '2010-09-02 00:00:00', '6', 'Carly Fiorina', 'Quote', 'http://articles.latimes.com/2010/sep/02/local/la-me-senate-20100902/2', 'Los Angeles Times', '0', '0', '0'),
(31, '"I was recruited to HP to save a company. It was a company that had grown into a bloated bureaucracy that cost too much and delivered too little to customers and shareholders. As an outsider, I tackled HP''s entrenched problems head-on, I cut the bureaucracy down to size, reintroduced accountability, focused on service, on innovation, on leading in every market and every product segment. It was a difficult time. However, we saved 80,000 jobs. We went on to grow to 160,000 jobs. I had to make tough calls in tough times. I think people are looking for that in Washington. I was fired over a disagreement in the boardroom. One of the things that people don''t understand is how accountable a CEO is. I had to report results every 90 days"', '<div style=&#39;padding:4px;border:solid 1px #000;background-color:#ddd;&#39;><div><div style=&#39;float:left;color:blue;font-weight:bold;&#39;>uname250</div><div style=&#39;float:right;font-size:13px;font-family:arial;&#39;>February 9, 2016 10:40 AM</div><div style=&#39;clear:both;&#39;></div></div><div style=&#39;margin-top:15px;&#39;>testiong testing 123</div></div>', '6', 'Carly Fiorina', '2016-02-09 10:40:00', '2015-10-29 00:00:00', '6', 'Carly Fiorina', 'Interview', 'http://www.cnbc.com/2015/10/29/cnbc-full-transcript-cnbcs-your-money-your-vote-the-republican-presidential-debate-part-2.html', 'CNBC', '0', '0', '1'),
(32, '“I am running for one reason and one reason only: And that is to rebuild the power of the truth of the American dream you and I share; that dream that was given to us by our parents, and grandparents. Not by their words, not by their hopes, but by the actions they took in their own lives to make our country better so that their children and grandchildren could have a better future.” ', '', '8', 'Martin O''malley', '2015-09-27 00:00:00', '2015-09-27 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://www.oskaloosa.com/news/local_news/presidental-candidate-o-malley-visits-oskaloosa/article_0f4562d7-d268-54d4-8e5c-abaec683aad1.html', 'Oskaloosa Herald Online', '0', '0', '0'),
(33, '“I think the relationship between the United States and Israel is strong, will remain strong, and must be strong for our own security, but also, we have to continue to wage peace, and in this context, waging peace means pushing for a two-state solution.”', '', '8', 'Martin O''malley', '2015-03-26 00:00:00', '2015-03-26 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://www.huffingtonpost.com/2015/03/26/martin-omalley-israel-_n_6952086.html', 'Huffington Post', '0', '0', '0'),
(34, '“If you hate the president so much you would rather support the ayatollah of Iran, you should probably not be in the United States Senate.”', '', '8', 'Martin O''malley', '2015-03-29 00:00:00', '2015-03-29 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://thehill.com/policy/international/237319-omalley-nuclear-iran-greatest-man-made-threat', 'ABC', '0', '0', '0');
INSERT INTO `president_issues` (`president_issuesID`, `president_issuesTitle`, `president_issuesCommentData`, `president_issuesCommentDataResponse`, `president_issuesSource`, `president_issuesLastComment_username`, `president_issuesLastComment`, `president_issues_createdate`, `president_issuesCreator_ID`, `president_issuesCreator_Username`, `president_issuesMedia_type`, `president_issuesMedia_typeLink`, `president_issues_group`, `president_issuesThumbsUp`, `president_issuesThumbsDown`, `president_issuesReplys`, `president_issuesCommsCount`) VALUES
(1, 'Immigration', 'The majority of legal immigrants can often make significant contributions to our society because they have special skills and because they add to our nation’s cultural diversity. They come with the best of intentions. But legal immigrants do not and should not enter easily. It’s a long, costly, draining, and often frustrating experience-by design. I say to legal immigrants: Welcome and good luck.<br/><br/>\nIt comes down to this: we must take care of our own people first. Our policy to people born elsewhere should be clear: Enter by the law, or leave.', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/male12_w.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname93</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>February 11, 2016 10:02 AM</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>How bout now?</span></div><div style=&#39;clear:both;&#39;></div><br/></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/male12_w.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname93</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:59:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>No added radiation</span></div><div style=&#39;clear:both;&#39;></div><br/></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:53:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>First!!!</span></div><div style=&#39;clear:both;&#39;></div><br/></div>', '3', 'uname93', '2016-02-11 10:02:00', '2016-01-20 00:00:00', '3', 'Donald Trump', '', '', 'Immigration', '4', '0', '0', '3'),
(2, 'The Economy - Taxes', 'America needs a bold, simple and achievable plan based on conservative economic principles.\r\nThis plan does that with needed tax relief for all Americans, especially the working poor and\r\nmiddle class, pro-growth tax reform for all sizes of businesses, and fiscally responsible steps to\r\nensure this plan does not add to our enormous debt and deficit.<br/><br/>\r\nThis plan simplifies the tax code by taking nearly 50% of current filers off the income tax rolls\r\nentirely and reducing the number of tax brackets from seven to four for everyone else. This plan\r\nalso reduces or eliminates loopholes used by the very rich and special interests made unnecessary\r\nor redundant by the new lower tax rates on individuals and companies', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/male6_l.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname20</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:53:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>Lookin mean Donal</span></div><div style=&#39;clear:both;&#39;></div><br/></div>', '3', 'uname20', '2016-02-11 09:53:00', '2016-01-25 00:00:00', '3', 'Donald Trump', '', '', 'The Economy', '1', '0', '0', '1'),
(3, 'Foreign Policy - China', 'China is bilking us for hundreds of billions of dollars by manipulating and devaluing its currency. Despite all the happy talk in Washington, the Chinese leaders are not our friends. I''ve been criticized for calling them our enemy. But what else do you call the people who are destroying your children''s and grandchildren''s future? What name would you prefer me to use for the people who are hell bent on bankrupting our nation, stealing our jobs, who spy on us to steal our technology, who are undermining our currency, and who are ruining our way of life? To my mind, that''s an enemy. If we''re going to make America number one again, we''ve got to have a president who knows how to get tough with China, how to out-negotiate the Chinese, and how to keep them from screwing us at every turn.', '', '3', 'Donald Trump', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '3', 'Donald Trump', '', '', 'Foreign Policy', '0', '0', '0', ''),
(4, 'Women issues - Abortion', 'Donald Trump shocked attendees at the conservative CPAC conference in February when he declared himself pro-life after years of supporting the pro-abortion position. Several months ago, when questioned about his position, Trump responded by saying the public "would be surprised" by his stance and, in an interview with Laura Ingraham from Fox News leading up to the conference, Trump characterized himself as "pro-life" and he repeated that apparent reversal when he told the audience at CPAC, "I am pro-life" and pledged to fight for the reversal of ObamaCare, which contains abortion funding loopholes.<br/><br/>I support a woman’s right to choose, but I am uncomfortable with the procedures. When Tim Russert asked me on Meet the Press if I would ban partial-birth abortion, my pro-choice instincts led me to say no. After the show, I consulted two doctors I respect and, upon learning more about this procedure, I have concluded that I would support a ban.', '', '3', 'Donald Trump', '2016-01-25 00:00:00', '2016-01-26 00:00:00', '3', 'Donald Trump', '', '', 'Civil Rights', '1', '0', '0', ''),
(5, 'Gun Control', 'I generally oppose gun control, but I support the ban on assault weapons and I support a slightly longer waiting period to purchase a gun. With today’s Internet technology we should be able to tell within 72-hours if a potential gun owner has a record.', '', '3', 'Donald Trump', '2016-01-25 00:00:00', '2016-01-25 00:00:00', '3', 'Donald Trump', '', '', 'The Constitution', '0', '0', '0', ''),
(6, 'Immigration', '"I do favor much more border patrolling and much more technology on both of our borders, and in certain areas, even a physical barrier, because I think we’ve got to secure our borders. That has to be part of comprehensive immigration reform. I have championed comprehensive immigration reform, and it includes starting with securing our borders in order to give people the support they need to come over and support us when it comes to having a pathway to legalization. We all know that this has become a contentious political issue. We want to work in a bipartisan way to have comprehensive reform--employer verification, more help for local communities so that they can pay for schooling and hospital and other expenses that they have to bear because of the immigration crisis."', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:36:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>Was passing at the same degtee.</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:26:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>ina dream setting</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:19:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>you can&#39;t bedistracted</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:16:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>wired magazine</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:04:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>comm hello</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div>the rod', '2', 'uname250', '2016-02-11 09:36:00', '2016-01-25 00:00:00', '2', 'Hillary Clinton', '', '', 'Immigration', '0', '0', '0', '6'),
(7, 'Immigration', '"I do. I believe that the great majority of people coming here illegally have no other option. They want to provide for their family. But we need to control our border. I did come up with a comprehensive strategy that really mirrored what we said in the book, which is that we need to deal with E-Verify, we need to deal with people that come with a legal visa and overstay. We need to be much more strategic on how we deal with border enforcement, border security. We need to eliminate the sanctuary cities in this country. It is ridiculous and tragic that people are dying because of the fact that local governments are not following the federal law. There''s much to do."', '', '1', 'Jeb Bush', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '1', 'JebBush', '', '', 'The Constitution', '0', '0', '0', ''),
(8, 'Civil Rights', 'Affirmative action - "In 1999, he ended affirmative action in state universities by executive order, becoming the first governor ever to do so."', '', '1', 'Jeb Bush', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '1', 'Jeb Bush', '', '', 'Civil Rights', '0', '0', '0', ''),
(9, 'Gun Control', '"Florida is a pro-gun state. Gun violence has dropped. There''s a reason for it. We created a balance that''s focused on lowering gun violence but protecting the Second Amendment, and it''s a model for many other countries and many other states because of that. These cases of people who are just mentally deranged--we as a society better figure out how we identify these folks long before they feel compelled to take up a gun and kill innocent people."', '', '1', 'Jeb Bush', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '1', 'Jeb Bush', '', '', 'Constitution', '0', '0', '0', ''),
(10, 'The Economy', '"The new normal of 2% puts huge demands on government. The reason we have deficits is that more people are relying on government. A 4% growth strategy starts with tax reform. We eliminate a lot of deductions and cut the rates down. A corporate rate of 20% would create an explosion of investment. I''m going to make sure that we shift power away from Washington and simplify the tax code. If we don''t do that, we''re stuck with the "new normal" of 2% growth"', '', '1', 'Jeb Bush', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '1', 'Jeb Bush', '', '', 'The Economy', '0', '0', '0', ''),
(11, 'Gun Control', '"I respect the Second Amendment. I respect the rights of lawful gun owners to own guns, to use their guns, but I also believe that most lawful gun owners whom I have spoken with for many years across our country also want to be sure that we keep those guns out of the wrong hands. And as president, I will work to try to bridge this divide, which I think has been polarizing and, frankly, doesn’t reflect the common sense of the American people. We will strike the right balance to protect the constitutional right but to give people the feeling & the reality that they will be protected from guns in the wrong hands."', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:57:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>Damn you Hillary!!</span></div><div style=&#39;clear:both;&#39;></div><br/></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/male6_l.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname20</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:47:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>Nothing uiseful</span></div><div style=&#39;clear:both;&#39;></div><br/></div>', '2', 'uname250', '2016-02-11 09:57:00', '2016-01-26 00:00:00', '2', 'Hillary Clinton', '', '', 'The Constitution', '0', '0', '0', '6'),
(12, 'Women''s rights', '"Women earn less than men across our economy—and women of color often lose out the most. Hillary will promote pay transparency across the economy and work to pass the Paycheck Fairness Act—a bill she introduced as senator—to give women the tools they need to fight workplace discrimination."', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:20:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>well alex</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:10:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>Like my love was an unad</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-10 14:42:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>hello to be absent form tehbod</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div>', '2', 'uname250', '2016-02-11 09:20:00', '2016-01-26 00:00:00', '2', 'Hillary Clinton', '', '', 'Civil Rights', '0', '1', '0', '3'),
(13, 'The Economy', '"Hillary will cut taxes for hard-working families to increase their take-home pay as they face rising costs from child care, health care, and sending their kids to college. She is calling for extending a tax cut of up to $2,500 per student to help deal with college costs as part of her New College Compact, and for cutting taxes for businesses that share profits with their employees.<br/><br/>One of the best ways to drive jobs and improve our nation’s competitiveness is to invest in infrastructure and scientific research. Hillary has called for a national infrastructure bank that would leverage public and private funds to invest in projects across the country. She will call for reform that closes corporate tax loopholes and drives investment here, in the U.S. And she would increase funding for scientific research at agencies like the National Institutes of Health and the National Science Foundation."', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:57:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>oprational</span></div><div style=&#39;clear:both;&#39;></div><br/></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>2016-02-11 09:19:00</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>clique</span></div><div style=&#39;clear:both;&#39;></div><br/><div style=&#39;text-align:center;font-size:12px;text-decoration:underline;cursor:pointer;&#39;>Reply</div></div>', '2', 'uname250', '2016-02-11 09:57:00', '2016-01-26 00:00:00', '2', 'Hillary Clinton', '', '', 'The Economy', '0', '0', '0', '2'),
(14, 'The Economy', '"Grow the economy by simplifying the tax code and making it fair, reduce corporate tax rates to reverse the flow of economic activity out of our nation, engage in only obviously necessary regulatory activities, enact wise energy policies and put the appropriate emphasis on relevant education."', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/male12_w.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname93</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>February 11, 2016 10:03 AM</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span style=&#39;font-weight:normal;&#39;>How dee doody</span></div><div style=&#39;clear:both;&#39;></div><br/></div>', '4', 'uname93', '2016-02-11 10:03:00', '2016-01-26 00:00:00', '4', 'Ben Carson', '', '', 'The Economy', '0', '0', '0', '1'),
(15, 'Immigration - Borders', '"The overwhelming majority of Americans want the southern borders of our country secured and our immigration laws enforced, but several administrations recently have been unwilling to get tough on this issue because they do not want to alienate a large voting block of Latinos. This is yet another area where our government''s leadership and the wishes of many of the people diverge and the people are being ignored.<br/><br/>Is it moral for us, for example, to take advantage of cheap labor from illegal immigrants while denying them citizenship? I''m sure you can tell from the way I phrased the question that I believe we have taken the moral low road on this issue. Some segments of our economy would virtually collapse without these undocumented workers--we all know that--yet we continue to harass and deport many individuals who are simply seeking a better life for themselves and their families. Is there a way to apply logic to this issue and arrive at an intelligent solution? All we have to do is look to our northern neighbor, Canada. They have a guest worker program, which allows people to enter the country as officially recognized guest workers who pay taxes, receive benefits, and are able to come and go as they please without infringing on anyone else''s rights."', '', '4', 'Ben Carson', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '4', 'Ben Carson', '', '', 'Immigration', '0', '0', '0', ''),
(16, 'Women''s rights - abortion', '“I was thinking about slavery and I was thinking about the abolitionists, and I said, what if the abolitionists had said, ‘I don’t believe in slavery but anybody else can do whatever they want’?” Carson declared. “Where would we be today?”\r\n<br><br>\r\n“Slavery is a moral issue and so is abortion,” he insisted. “It’s a moral issue that we’re dealing with.”', '', '4', 'Ben Carson', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '4', 'Ben Carson', '', '', 'Civil Rights', '1', '0', '0', ''),
(17, 'Gun rights', '"As President, I vow to uphold our entire Bill of Rights, but specifically our right to bear arms. I will not support any proposed gun control law which would limit the right to gun ownership by those who are responsible, law-abiding citizens. In the White House, I will remain vigilant in the fight against infringements on our Second Amendment rights."', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', '', '', 'The Constitution', '0', '0', '0', ''),
(18, 'Immigration', '"I do not support amnesty, but rather I support a legal immigration process. I recognize that our country has been enriched by those who seek the American Dream and have a desire for a better life. However, millions of illegal immigrants are crossing our border without our knowledge, and this threatens our national security.\r\n<br/><br/>\r\nAs President, I would secure our border immediately. Before issuing any visas or starting the legal immigration process, we must first ensure that our border is secure.\r\n\r\nWhile serving in the Senate, I introduced legislation that would make immigration reform conditional on Congress voting on whether the border is secure, requiring completion of a border fence in five years and a protection against the federal government establishing a national identification card system for citizens."', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', '', '', 'Immigration', '0', '0', '0', ''),
(19, 'Women''s rights - Abortion', '"I strongly believe in the sanctity of life. I believe that life begins at conception and that abortion takes the life of an innocent human being. Under the 14th Amendment, it is the government’s duty to protect life as defined in our Constitution."', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', '', '', 'Civil Rights', '1', '0', '0', ''),
(20, 'The economy - Taxes', '"I am announcing an over $2 trillion tax cut that would repeal the entire IRS tax code—more than 70,000 pages—and replace it with a low, broad-based tax of 14.5% on individuals and businesses. I would eliminate nearly every special-interest loophole. The plan also eliminates the payroll tax on workers and several federal taxes outright, including gift and estate taxes, telephone taxes, and all duties and tariffs. I call this “The Fair and Flat Tax."', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', '', '', 'The Economy', '0', '0', '0', ''),
(21, 'Foreign policy - Russia', '"We need to be opposing Putin in parts of the world other than Syria. It''s not just keeping his influence out of the Middle East, which he truly wants, but also in his own area of the world, the whole Baltic Basin, we need to have more than one or two armored brigades there to show some strength. And particularly you look at the Baltic States, they''re really quite nervous about him."', '', '4', 'Ben Carson', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '4', 'Ben Carson', '', '', 'Foreign Policy', '0', '0', '0', ''),
(22, 'Immigration', 'Make no mistake, this is not an amnesty bill. We are not here to reward law-breakers, and any accusations to the contrary are patently untrue. This bill recognizes the problems inherent in the current system and provides a logical and effective means to address these problems. It would be impossible to identify and round up all 10 to 11 million of the current undocumented, and if we did, it would ground our Nation''s economy to a halt. These millions of people are working. Aliens will not come forward to simply "report and deport." We have a national interest in identifying these individuals, incentivizing them to come forward out of the shadows, go through security background checks, pay back taxes, pay penalties for breaking the law, learn to speak English, and regularize their status. Anyone who thinks this goal can be achieved without providing an eventual path to a permanent legal status is not serious about solving this problem.', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/a-fair-and-humane-immigration-policy/', 'Immigration', '0', '0', '0', ''),
(23, 'Women''s rights - Pay', 'It is a national disgrace that women only earn 78 cents for every dollar a man earns. The gender pay gap is even worse for women of color. Today, African American women earn just 64 cents for every dollar a white male earns, while the figure for Hispanic women is just 54 cents. As president, Sen. Sanders will sign the Paycheck Fairness Act into law to end wage discrimination based on gender.', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', '', 'https://berniesanders.com/issues/fighting-for-womens-rights/', 'Civil Rights', '0', '0', '0', ''),
(24, 'Economy - Banks', 'We must break up too-big-to-fail financial institutions. Those institutions received a $700 billion bailout from the US taxpayer, and more than $16 trillion in virtually zero interest loans from the Federal Reserve. Despite that, financial institutions made over $152 billion in profit in 2014 – the most profitable year on record, and three of the four largest financial institutions are 80% bigger today than they were before we bailed them out. ?', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/reforming-wall-street/', 'The Economy', '0', '0', '0', ''),
(25, 'Civil Rights - Racism, Police brutality', 'It is an outrage that in these early years of the 21st century we are seeing intolerable acts of violence being perpetrated by police and racist acts of terrorism by white supremacists.<br/><br/>\n\nA growing number of communities do not trust the police. Law enforcement officers have become disconnected from the communities they are sworn to protect. Violence and brutality of any kind, particularly at the hands of the police meant to protect and serve our communities, is unacceptable and must not be tolerated. We need a societal transformation to make it clear that black lives matter and racism will not be accepted in a civilized country.\n<div style=''padding-left:50px;''><ul><li>We must demilitarize our police forces so they don’t look and act like invading armies.</li>\n<li>We must invest in community policing. Only when we get officers into the communities, working within neighborhoods before trouble arises, do we develop the relationships necessary to make our communities safer together. Among other things, that means increasing civilian oversight of police departments.</li>\n<li>We must create a police culture that allows for good officers to report the actions of bad officers without fear of retaliation and allows for a department to follow through on such reports.</li>\n<li>We need police forces that reflect the diversity of our communities, including in the training academies and leadership.</li>\n<li>At the federal level, we need to establish a new model police training program that reorients the way we do law enforcement in this country. With input from a broad segment of the community including activists and leaders from civil rights organizations we will reinvent how we police America.</li>\n<li>We need to federally fund and require body cameras for law enforcement officers to make it easier to hold them accountable.</li>\n<li>We need to require police departments and states to collect data on all police shootings and deaths that take place while in police custody and make that data public.</li>\n<li>We need new rules on the allowable use of force. Police officers need to be trained to de-escalate confrontations and to humanely interact with people who have mental illnesses.\nStates and localities that make progress in this area should get more federal justice grant money. Those that do not should get their funding slashed.</li>\n<li>We need to make sure federal resources are there to crack down on the illegal activities of hate groups.</li></ul></div>', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/racial-justice/', 'Civil Rights', '0', '0', '0', ''),
(26, 'Immigration', 'The first thing I will do is secure the border. It will take money, manpower, technology and—most of all—political will. Then we must fix our legal immigration system, including the broken visa system. I will not support citizenship for those here illegally. Those who broke our laws as their first act in this country have foregone that opportunity.\r\n', '', '6', 'Carly Fiorina', '2016-02-06 00:00:00', '2016-02-04 00:00:00', '6', 'Carly Fiorina', '', '', 'Immigration', '0', '0', '0', ''),
(27, 'Economy - Budget', 'Let us go to zero-based budgeting so we know where the money is being spent. There is a bill in the House that would have us go to zero-based budgeting so we know where every dime of your money is being spent instead of only talking about how much more we''re going to spend year after year after year. We need to tackle the basics to cut this government down to size and hold it accountable. Let''s start by knowing where your money is being spent by the federal government.', '', '6', 'Carly Fiorina', '2016-02-02 00:00:00', '2016-02-02 00:00:00', '6', 'Carly Fiorina', '', 'http://ontheissues.org/2016/Carly_Fiorina_Budget_+_Economy.htm', 'The Economy', '0', '1', '0', ''),
(28, 'Womens Rights - Abortions', '"Fiorina supports the Pain-Capable Unborn Child Protection Act, which bans abortions 20 weeks after fertilization, except in cases of rape, incest or danger to the life of the mother. In the past she has said that, if given the opportunity, she would vote to overturn Roe v Wade."', '', '6', 'Carly Fiorina', '2016-02-02 00:00:00', '2016-02-02 00:00:00', '6', 'Carly Fiorina', '', '', 'Civil Rights', '1', '0', '0', ''),
(29, 'Civil rights - Gay - Lesbian', 'I do believe that marriage is between a man and a woman, but also have been consistent and clear that I support civil unions for gay and lesbian couples.', '', '6', 'Carly Fiorina', '2010-09-02 00:00:00', '2010-09-02 00:00:00', '6', 'Carly Fiorina', '', '', 'Civil Rights', '1', '0', '0', ''),
(30, 'Gun Control', '<div style=''padding-left:50px;''><ul><li>Require a background check for every gun sale.</li>\n<li>End unregulated internet gun and ammunition sales.</li>\n<li>Enact comprehensive requirements for gun purchases, including fingerprint licensing</li>\n<li>Ban guns for those subject to emergency restraining orders.</li>\n<li>Mandate reporting to law enforcement of lost or stolen firearms.</li>\n<li>Revoke licenses when dealers break the law.</li>\n<li>End immunity for gun manufacturers.</li></ul>\n<br><a href=''https://martinomalley.com/policy/preventing-and-reducing-gun-violence/'' target=''_blank''>More</a>....</div>', '', '8', 'Martin O''Malley', '2016-02-02 00:00:00', '2016-02-02 00:00:00', '8', 'Martin O''Malley', '', 'https://martinomalley.com/policy/preventing-and-reducing-gun-violence/', 'Constitution', '0', '0', '0', ''),
(31, 'The Economy - wages', 'Raise the minimum wage however we can, wherever we can so no-one who works hard and plays by the rules ever has to raise their children in poverty.', '', '8', 'Martin O''Malley', '2016-02-23 00:00:00', '2016-02-23 00:00:00', '8', 'Martin O''Malley', 'Website', '', 'The Economy', '0', '0', '0', '0'),
(32, 'Women''s Rights - Abortion', 'I am pro-choice. I also believe that there are some issues that the government''s no good at making for individuals. Among those decisions, are decisions made between women and their doctors. I believe that all of us can make a lot of strides as a country in reducing infant mortality and eradicating childhood hunger. And that''s the common good, and that''s the work we focus on even as we leave to the individual''s conscience some of these other decisions the government''s just no good at.', '', '8', 'Martin O''Malley', '2016-02-24 00:00:00', '2016-02-24 00:00:00', '8', 'Martin O''Malley', 'Website', 'http://www.ontheissues.org/2016/Martin_O%60Malley_Abortion.htm', 'Civil Rights', '0', '0', '0', '0'),
(33, 'GBLT rights', 'We all want the same thing for our children; we want our children to live in a loving, caring, committed, and stable home protected equally under the law. It is not right or just that the children of gay couples should have lesser protections than the children of other families in our State. Nor would it be right to force religious institutions to conduct marriages that conflict with their own religious beliefs and teachings.', '', '8', 'Martin O''Malley', '2016-02-23 00:00:00', '2016-02-23 00:00:00', '8', 'Martin O''Malley', '', '', 'Civil Rights', '0', '0', '0', '0'),
(34, 'Health Care', 'Look, the larger battle is to bring down the cost of health care which is keeping us from being a more productive country. The perceptions of the Affordable Care Act will greatly change once the enrollment period comes to close by the end of March. By the end of March, you will see most states hitting their goals, you''ll see our country having extended health care with more people. And all of those that have been scared and frightened that somehow something is going to happen to their health care will realize that those scare tactics were not true, that those were just falsehoods pedaled by the ideological right.', '', '8', 'Martin O''Malley', '2016-02-23 00:00:00', '2016-02-23 00:00:00', '8', 'Martin O''Malley', '', 'http://www.ontheissues.org/2016/Martin_O%60Malley_Gun_Control.htm', 'Health Care', '0', '0', '0', '0'),
(35, 'Foreign Policy - Israel', '<div style=''padding-left:120px;''><ul><li>Strengthen the U.S.-Israel Alliance and Israel’s Self-Defense.</li>\n<li>End unregulated internet gun and ammunition sales.</li>\n<li>Revoke President Obama’s Flawed Iran Deal.</li>\n<li>Defend Israel’s Efforts to Combat Terrorism.</li>\n<li>Fight Efforts to Delegitimize the Jewish State.</li>\n<li>Push to Move the U.S. Embassy from Tel Aviv to Jerusalem.</li>\n</ul>\n</div>', '<div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>February 25, 2016 9:28 AM</span></div><br/><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;display:inline-block;padding-left:8px;font-weight:bold;&#39;>Comment:</span></div><br/></div><div style=&#39;width:460px;text-align:left;&#39;><span class=&#39;commStyle1&#39; style=&#39;font-size:14px;font-weight:normal;&#39;>We must be careful of the zionist though. Marco you seem like a paid shil.</span></div><div style=&#39;clear:both;&#39;></div><br/></div><div class=&#39;issuesComments&#39; style=&#39;padding:10px;&#39;><div style=&#39;float:left;width:95px;&#39;><img src=profileImages/female8_b.jpg height=&#39;90&#39; width=&#39;95&#39; border=&#39;1&#39; align=&#39;left&#39; /></div><div style=&#39;float:left;width:360px;&#39;><div style=&#39;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padding-left:8px;&#39;>uname250</span></div><div style=&#39;width:300px;text-align:left;&#39;><span style=&#39;font-weight:bold;display:inline-block;padd